import React, { Component } from "react";
import Pnav from "../Projects";
import Grim1 from "./Grimeton/1.png";
import Grim2 from "./Grimeton/2.png";
import Grim3 from "./Grimeton/3.png";
import Grim4 from "./Grimeton/4.png";
import Grim5 from "./Grimeton/5.png";
import Grim6 from "./Grimeton/6.png";
import Grim7 from "./Grimeton/7.png";
import Grim8 from "./Grimeton/8.png";
import Draggable from "react-draggable";
import Drag from "../Draggable";

export default class Grimeton extends Component {
  constructor(props) {
    super(props);

    this.state = {
      header: "Header from state...",
      medium: "Print",
      category: "Identity",
      content: `Grimeton Radio Station (Radiostation in swedish) is located outside Varberg on the Swedish west coast. It was very important for Scandinavia during world war II. The long wave radio transmitter was during periods the only ways for Scandinavia to communicate with the US.
      It was added to the Unesco World Heritage List in 2004, with the statement: "Grimeton Radio Station, Varberg is an outstanding monument representing the process of development of communication technology in the period following the First World War."

      In a school assignment, I combined a text about the daily life at Grimeton Radio Station with a general text about Unesco and the mission to preserve important sites around the world.`
    };
  }
  render() {
    return (
      <div>
        <Pnav />
        <Draggable className="test">
          <div className="descriptionbox">
            <p className="projectname">{this.state.header}</p>
            <p className="projectmedium">{this.state.medium}</p>
            <p className="projectcat">{this.state.category}</p>
            <p className="projectname">{this.state.content}</p>
          </div>
        </Draggable>
        <p>hello</p>
        <div className="imagebox">
          <img className="Grimbild" src={Grim1} />
          <img className="Grimbild" src={Grim2} />
          <img className="Grimbild" src={Grim3} />
          <img className="Grimbild" src={Grim4} />
          <img className="Grimbild" src={Grim5} />
          <img className="Grimbild" src={Grim6} />
          <img className="Grimbild" src={Grim7} />
          <img className="Grimbild" src={Grim8} />
        </div>
      </div>
    );
  }
}
